function Header() {
  return (
    <div className="flex h-10 bg-blue-300 justify-around">
      <div className="Logo">
        <span>LOGO</span>
      </div>
      <div className="country"></div>
      <div className="for client"></div>
      <div className=""></div>
      <div className="Shopping"></div>
    </div>
  );
}

export default Header;
